import React, {useContext} from 'react';
import { CartContext } from '../CartContext/CartContext';

export const CartContainer = () => {
    const value = useContext(CartContext)

    return (
        <div>
            CartContainer
            <div>
                {value.productCartList.map(item=>(
                    <p>{item.name} - {item.quantity}</p>
                ))}
            </div>
        </div>
    )
}
